Поздравляем! В рамках тарифного плана «Игровой» вам стали доступны:
%(vehicles)s
• Экипаж, обученный на 100%% (включая полностью изученный навык «Боевое братство»);
• %(prem)s на время действия тарифа;
• Дополнительный слот в Ангаре.

После демобилизации сюда попадают только те члены экипажей, у которых достаточно опыта для развития одного умения или навыка на 100%% (или как минимум одно умение или навык уже развиты). В течение %(totalDays)s д. вы можете вернуть такого члена экипажа в строй:
• бесплатно — в ближайшие %(freeDays)s д.;
• за %(price)s — в последующие %(paidDays)s д.
